import { FastifyRequest, FastifyReply, FastifyInstance } from 'fastify';
import { Controller, ErrorHandler, FastifyInstanceToken, GET, Hook, Inject, POST } from 'fastify-decorators';
import { FastifyRequestError } from '@/types/global';
import fetch from '@/common/fetch/index';

const whiteList = ['/login', '/register'];

@Controller({ route: '/service' })
export default class ServiceController {
  @Inject(FastifyInstanceToken)
  private instance!: FastifyInstance


  @POST({ url: '/sdImage' })
  async handleSDImage(request: FastifyRequest<{
    Body: {
      image: string;
    }
  }>, reply: FastifyReply) {
    const img = request.body.image;
    const params = {
      "init_images": [
        img
      ],
      "denoising_strength": 0.5 - Math.random() * 0.2,
      "image_cfg_scale": 0,
      "mask_blur": 4,
      "inpainting_fill": 0,
      "inpaint_full_res": true,
      "prompt": "",
      "seed": -1,
      "subseed": -1,
      "subseed_strength": 0,
      "seed_resize_from_h": -1,
      "seed_resize_from_w": -1,
      "batch_size": 2,
      "n_iter": 1,
      "steps": 50,
      "cfg_scale": 7,
      "width": 512,
      "height": 512
    }
    const url = "http://localhost:7860/sdapi/v1/img2img";
    return fetch.post(url, params);
  }

  @ErrorHandler()
  async handleQueryUserError(error: FastifyRequestError, request: FastifyRequest, reply: FastifyReply) {
    console.error(error);
    reply.send({
      code: 500,
      message: error.message,
    })
  }
}


